      "e-print metadata\n",
      "arxiv-id: 1207.4169v1\n",
      "Published: 2012-07-11T15:05:53Z\n",
      "Title:  The Author-Topic Model for Authors and Documents\n",
      "Last Author:  Padhraic Smyth\n",
      "Authors:  Michal Rosen-Zvi, Thomas Griffiths, Mark Steyvers, Padhraic Smyth\n",
      "Abstract: We introduce the author-topic model, a generative model for documents that\n",
      "extends Latent Dirichlet Allocation (LDA; Blei, Ng, & Jordan, 2003) to include\n",
      "authorship information. Each author is associated with a multinomial\n",
      "distribution over topics and each topic is associated with a multinomial\n",
      "distribution over words. A document with multiple authors is modeled as a\n",
      "distribution over topics that is a mixture of the distributions associated with\n",
      "the authors. We apply the model to a collection of 1,700 NIPS conference papers\n",
      "and 160,000 CiteSeer abstracts. Exact inference is intractable for these\n",
      "datasets and we use Gibbs sampling to estimate the topic and author\n",
      "distributions. We compare the performance with two other generative models for\n",
      "documents, which are special cases of the author-topic model: LDA (a topic\n",
      "model) and a simple author model in which each author is associated with a\n",
      "distribution over words rather than a distribution over topics. We show topics\n",
      "recovered by the author-topic model, and demonstrate applications to computing\n",
      "similarity between authors and entropy of author output.\n",
      "e-print metadata\n",
      "arxiv-id: physics/0002037v2\n",
      "Published: 2000-02-20T12:33:46Z\n",
      "Title:  Post acceleraed Frames\n",
      "Last Author:  Erez M. Yahalomi\n",
      "Authors:  Erez M. Yahalomi\n",
      "Abstract: This paper has been withdrawn by the author due to similarity to the author's\n",
      "other paper\n",
      "e-print metadata\n",
      "arxiv-id: 0902.0755v1\n",
      "Published: 2009-02-04T17:36:41Z\n",
      "Title:  A Simple Extraction Procedure for Bibliographical Author Field\n",
      "Last Author:  Pere Constans\n",
      "Authors:  Pere Constans\n",
      "Abstract: A procedure for bibliographic author metadata extraction from scholarly texts\n",
      "is presented. The author segments are identified based on capitalization and\n",
      "line break patterns. Two main author layout templates, which can retrieve from\n",
      "a varied set of title pages, are provided. Additionally, several disambiguating\n",
      "rules are described.\n",
      "e-print metadata\n",
      "arxiv-id: 1602.03596v1\n",
      "Published: 2016-02-11T01:20:38Z\n",
      "Title:  A Typed Model for Dynamic Authorizations\n",
      "Last Author:  Hugo Torres Vieira (IMT Institute for Advanced Studies Lucca, Italy)\n",
      "Authors:  Silvia Ghilezan, Svetlana Jakšić, Jovanka Pantović, Jorge A. Pérez, Hugo Torres Vieira\n",
      "Abstract: Security requirements in distributed software systems are inherently dynamic.\n",
      "In the case of authorization policies, resources are meant to be accessed only\n",
      "by authorized parties, but the authorization to access a resource may be\n",
      "dynamically granted/yielded. We describe ongoing work on a model for specifying\n",
      "communication and dynamic authorization handling. We build upon the pi-calculus\n",
      "so as to enrich communication-based systems with authorization specification\n",
      "and delegation; here authorizations regard channel usage and delegation refers\n",
      "to the act of yielding an authorization to another party. Our model includes:\n",
      "(i) a novel scoping construct for authorization, which allows to specify\n",
      "authorization boundaries, and (ii) communication primitives for authorizations,\n",
      "which allow to pass around authorizations to act on a given channel. An\n",
      "authorization error may consist in, e.g., performing an action along a name\n",
      "which is not under an appropriate authorization scope. We introduce a typing\n",
      "discipline that ensures that processes never reduce to authorization errors,\n",
      "even when authorizations are dynamically delegated.\n",
      "e-print metadata\n",
      "arxiv-id: 1706.00593v1\n",
      "Published: 2017-06-02T08:52:47Z\n",
      "Title:  Joint Modeling of Topics, Citations, and Topical Authority in Academic\n",
      "  Corpora\n",
      "Last Author:  Alice Oh\n",
      "Authors:  Jooyeon Kim, Dongwoo Kim, Alice Oh\n",
      "Abstract: Much of scientific progress stems from previously published findings, but\n",
      "searching through the vast sea of scientific publications is difficult. We\n",
      "often rely on metrics of scholarly authority to find the prominent authors but\n",
      "these authority indices do not differentiate authority based on research\n",
      "topics. We present Latent Topical-Authority Indexing (LTAI) for jointly\n",
      "modeling the topics, citations, and topical authority in a corpus of academic\n",
      "papers. Compared to previous models, LTAI differs in two main aspects. First,\n",
      "it explicitly models the generative process of the citations, rather than\n",
      "treating the citations as given. Second, it models each author's influence on\n",
      "citations of a paper based on the topics of the cited papers, as well as the\n",
      "citing papers. We fit LTAI to four academic corpora: CORA, Arxiv Physics, PNAS,\n",
      "and Citeseer. We compare the performance of LTAI against various baselines,\n",
      "starting with the latent Dirichlet allocation, to the more advanced models\n",
      "including author-link topic model and dynamic author citation topic model. The\n",
      "results show that LTAI achieves improved accuracy over other similar models\n",
      "when predicting words, citations and authors of publications.\n"
